import React from 'react';

const Home = () => {
  return (
    <div className="home">
      <h1>Selamat datang di Toko Donat!</h1>
      <p>Selamat berbelanja donat yang lezat dan menggiurkan ini.</p>
    </div>
  );
};

export default Home;
